import React from "react";
import styles from "../styles/Todo.module.scss";

const Todo = () => {
  return (
    <div className={styles.todo}>
      <div className={styles.panel}>
        <h1>待辦清單</h1>
        <div className={styles.status_panel}>
          <button>未完成</button>
          <button>已完成</button>
        </div>
      </div>
      <form>
        <input type="text" placeholder="新增待辦事項" />
        <button />
      </form>
    </div>
  );
};

export default Todo;
